import styled from "styled-components";
import Motor from "../Motor/Motor";


const Container = styled.div`
  margin-left: 15px;
  margin-top: 20px;
  width: 100%;
  height: 400px;
  background-color: #444;
`;

function CardModelos() {
  return (
    <Container>

          <Motor/>

    </Container>
  );
}

export default CardModelos;
